const shopData = [];

function generateNewSingleData() {
  const newData = {};
  fetch('https://dog.ceo/api/breeds/image/random')
    .then(res => res.json())
    .then(data => {
      newData.id = shopData.length + 1;
      newData.name = `Doggie ${newData.id}`;
      newData.imageUrl = data.message;
      newData.price = Math.floor(Math.random() * 10) + 1;
      shopData.push(newData);
    });
}

async function generateDataCollection() {
  for (let i = 0; i < 10; i++) {
    await generateNewSingleData();
  }
}

generateDataCollection();

export default shopData;
